/*Table structure for table `teach_book` */

DROP TABLE IF EXISTS `teach_book`;

CREATE TABLE `teach_book` (
  `book_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '书本id',
  `book_name` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '书本名称',
  `book_eep_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '书本在eep系统中的id',
  `book_isbn` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '本书isbn',
  `book_publisher` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '出版社名称',
  `book_page_count` int(11) DEFAULT NULL COMMENT '书本页码数量',
  `book_cover1_img_fileid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '封面图片文件id',
  `book_cover2_img_fileid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '书脊图片文件id',
  `book_cover3_img_fileid` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '封底图片文件id',
  `book_pub_state` int(1) DEFAULT '0' COMMENT '图书上架状态，0：未上架，1：上架，2：下架',
  `book_pub_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图书上架操作者',
  `book_pub_time` datetime DEFAULT NULL COMMENT '图书上架时间',
  `book_close_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图书下架操作者',
  `book_close_time` datetime DEFAULT NULL COMMENT '图书下架时间',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图书创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图书更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志，0:未删除，1：已删除',
  PRIMARY KEY (`book_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

