  `dir_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '目录id',
  `book_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '书本id',
  `dir_type` int(1) NOT NULL COMMENT '目录类型，0：章，1：节  2:书',
  `parent_dir_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '父目录id,如果为章，为书本id，如果为小节，为章id',
  `no` int(11) NOT NULL DEFAULT '0' COMMENT '序号，章：表示在书中的排序号，小节：表示在章中的排序号',
  `yun_disk_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '云盘磁盘id，为空表示书本目录未同步到云盘，不为空表示已同步',
  `dir_name` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '目录名称',
  `page_count` int(11) DEFAULT '0' COMMENT '包含的页码数量',
  `start_page` int(11) DEFAULT '0' COMMENT '开始页码，第一个包含该小节内容的页码',
  `end_page` int(11) DEFAULT '0' COMMENT '结束页码，最后一个包含该小节的页码',
  `insert_no` int(11) DEFAULT '999999' COMMENT '导入时目录的顺序，用于目录排列使用',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `teach_book_dir` */

/*Table structure for table `teach_book_page` */

DROP TABLE IF EXISTS `teach_book_page`;

CREATE TABLE `teach_book_page` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `book_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `page_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `chapter_no` int(11) NOT NULL DEFAULT '0',
  `section_no` int(11) NOT NULL DEFAULT '0',
  `page_no` int(11) NOT NULL DEFAULT '0',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `del_flag` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `teach_book_page` */

/*Table structure for table `teach_process` */

DROP TABLE IF EXISTS `teach_process`;

CREATE TABLE `teach_process` (
  `process_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '过程id',
  `user_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户id',
  `book_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '书本id',
  `book_chapter_dir_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '资源所在章节id',
  `book_chapter_no` int(11) DEFAULT '0' COMMENT '章节在书中的序号：0表示不输入任何章',
  `book_chapter_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '章节名称',
  `book_section_dir_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '资源所在小节id',
  `book_section_no` int(11) DEFAULT '0' COMMENT '小节在书中的序号：0表示不在任何小节',
  `book_section_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '小节名称',
  `page_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `page_num` int(11) DEFAULT '0' COMMENT '所在页码',
  `detail_count` int(11) NOT NULL DEFAULT '0',
  `process_name` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '过程名称',
  `process_type` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '过程类型',
  `process_note` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '过程备注',
  `pos_x` int(11) DEFAULT '0' COMMENT '过程所在页码的坐标x：坐标的左上角是0，0。 范围是基于半页的坐标',
  `pos_y` int(11) DEFAULT '0' COMMENT '过程所在页码的坐标y：',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志',
  PRIMARY KEY (`process_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `teach_process` */

/*Table structure for table `teach_process_detail` */

DROP TABLE IF EXISTS `teach_process_detail`;

CREATE TABLE `teach_process_detail` (
  `detail_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '过程详细id',
  `process_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '过程id',
  `user_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户id',
  `detail_no` int(11) NOT NULL DEFAULT '0' COMMENT '此详细在过程中的顺序',
  `resource_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '资源id',
  `file_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '原始文件id',
  `file_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '原始文件名',
  `file_ext_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '原始文件扩展名',
  `file_download_flag` int(1) DEFAULT '0' COMMENT '下载状态标志：0:未下载，1:已经下载',
  `need_trans` int(1) DEFAULT '0' COMMENT '是否需要转换格式：0:不需要,1:需要',
  `trans_file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '转换后文件id',
  `trans_file_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '转换后的文件名',
  `trans_file_ext_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '转换后的扩展名',
  `trans_file_download_flag` int(1) DEFAULT '0' COMMENT '转换后的下载状态标志',
  `detail_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '详细名称',
  `detail_type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '详细类型',
  `detail_note` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '详细备注',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志：',
  PRIMARY KEY (`detail_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `teach_process_detail` */

