/*Table structure for table `yun_disk` */

DROP TABLE IF EXISTS `yun_disk`;

CREATE TABLE `yun_disk` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '磁盘目录id',
  `dir_flag` int(1) NOT NULL DEFAULT '0' COMMENT '目录标志：0:目录,1:文件',
  `pub_flag` int(1) NOT NULL DEFAULT '0' COMMENT '公开标志：0:私有不公开，1:私有公开，2:公开',
  `parent_id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '所在目录id',
  `name` varchar(300) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件/目录的名称',
  `file_ext_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件扩展名：仅对文件有效',
  `file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件id：仅对文件有效',
  `size` int(11) NOT NULL DEFAULT '0' COMMENT '文件大小(KB)：仅对文件有效，目录为0',
  `tag_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '标签名：用户自定义标签，有多个，用逗号隔开，用于搜索',
  `search_word` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '搜索关键字：系统生成，用于搜索',
  `order_no` int(11) DEFAULT '999999' COMMENT '目录排序的依据',
  `snap_file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `preview_file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `h5media_file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建用户',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新用户',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志',
  `md5` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

