/*Table structure for table `yun_file` */

DROP TABLE IF EXISTS `yun_file`;

CREATE TABLE `yun_file` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '文件ID',
  `file_name` varchar(300) COLLATE utf8_unicode_ci NOT NULL COMMENT '文件名(包含扩展名)',
  `md5` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '文件MD5值，根据此判断文件是否为同一个文件，网盘中同一个MD5值的文件只保留1份',
  `ext_name` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '文件扩展名',
  `file_size` int(11) NOT NULL DEFAULT '0' COMMENT '文件大小',
  `snap_file_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) NOT NULL DEFAULT '0' COMMENT '删除标志',
  PRIMARY KEY (`id`)
