/*Table structure for table `yun_user` */

DROP TABLE IF EXISTS `yun_user`;

CREATE TABLE `yun_user` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户Id',
  `login_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '登录名',
  `screen_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '昵称',
  `real_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `role_type` int(1) DEFAULT '0' COMMENT '用户角色：0：普通用户，1：系统管理员，2：高级管理员',
  `gender` int(1) DEFAULT '0' COMMENT '性别：0：未设置，1：男，2女',
  `password` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '密码',
  `password_salt` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '密码盐',
  `email` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邮箱',
  `telephone` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电话',
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '手机',
  `address` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '通讯地址',
  `province_id` int(11) DEFAULT NULL COMMENT '所在省份Id',
  `city_id` int(11) DEFAULT NULL COMMENT '所在城市Id',
  `district_id` int(11) DEFAULT NULL COMMENT '所在区域Id',
  `school_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '学校名称',
  `is_verity` int(1) DEFAULT NULL COMMENT '是否确认',
  `last_login_time` datetime DEFAULT NULL COMMENT '最近登录时间',
  `last_login_ip` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最近登录ip',
  `ext_info1` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展备用信息1',
  `ext_info2` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展备用信息2',
  `ext_info3` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展备用信息3',
  `ext_info4` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展备用信息4',
  `ext_info5` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展备用信息5',
  `create_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '创建者',
  `update_user` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '更新者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志:1:表示删除，0：表示未删除',
  `grade` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

